_initMouse() {

  this.mouse = TermMouse({

    input: config.input,

    output: config.output,

  });

  this.mouse.start();



  this.mouse.on('click', (event) => this._onClick(event));

  this.mouse.on('scroll', (event) => this._onMouseScroll(event));

  this.mouse.on('move', (event) => this._onMouseMove(event));

}
